const config = [
  {
    name: "Label",
    keyValue: "label",
    width: "30%",
  },
  {
    name: "Title",
    keyValue: "title",
    width: "30%",
  },
  {
    name: "Track Info",
    keyValue: "trackinfo",
    width: "30%",
  },
  {
    name: "Year",
    keyValue: "year",
    width: "10%",
  },
];

export default config;
